import React from "react";
import { Link } from "react-router-dom";
import CheckUsers from "../../useEffect/CheckUsers";

const RoleAdmin = () => {
  return (
    <div>
      <h1>INI ADMIN</h1>
      <CheckUsers />
      <Link to={"/admin"}>INI admin</Link>
    </div>
  );
};

export default RoleAdmin;
